import { Fragment, useEffect } from "react";

import QuoteList from "../components/quotes/QuoteList";
import useHttp from "../components/hooks/use-http";
import { getAllQuotes } from "../components/lib/api";

const DUMMY_QUOTES = [
  {
    id: "q1",
    author: "Shivam",
    text: "Whoso neglects learning in his youth, losses the past and is dead for the future",
  },
  {
    id: "q2",
    author: "Jitendra",
    text: "Build in Private",
  },
  {
    id: "q3",
    author: "Shivam",
    text: "Everyone is working to be seen, i am working to disappear",
  },
];
const AllQuotes = () => {
  useEffect(() => {
    const {
      sendRequest,
      status,
      data: leadedQuotes,
      error,
    } = useHttp(getAllQuotes);
  }, []);

  return (
    <Fragment>
      <QuoteList quotes={DUMMY_QUOTES} />
    </Fragment>
  );
};

export default AllQuotes;
